import React from "react"

export const TextListCards = ({texts}) => {
    if(texts.length === 0) {
        return <h5 className="center">No Texts. Create one!</h5>
    }

    return(
        <table>
            <thead>
            <tr>
                <th>Text</th>
                <th></th>
            </tr>
            </thead>

            <tbody>
            {texts.map(text => {
                return (
                    <tr>
                        <td>text.value</td>
                    </tr>
                )
            })}
            </tbody>
        </table>
    )
}
